import React, { useState } from 'react';
import CaliforniaFireMap from './components/CaliforniaFireMap';
import './App.css';

const App = () => {
  const [activeTab, setActiveTab] = useState('dashboard');
  const [newDatasetId, setNewDatasetId] = useState(null);



  return (
    <div className="app-container">
      <nav className="app-nav">
        <div className="app-logo">GeoViz Dashboard</div>
        <div className="app-tabs">
          <button 
            className={`tab-button ${activeTab === 'california' ? 'active' : ''}`}
            onClick={() => setActiveTab('california')}
          >
            California Fire Map
          </button>
        </div>
      </nav>

      <main className="app-content">

        {activeTab === 'california' && (
          <div className="california-page">
            <h1>California Fire Map</h1>
            <CaliforniaFireMap dataset={newDatasetId || 'default'} />
          </div>
        )}

      </main>

      <footer className="app-footer">
        <p>Â© 2025 GeoViz Dashboard. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
